window.bookSummaryJSON = "<p><b>Leveling up. Fighting death. Living life to the max.</b></p> <p>Zeke and his comrades have only been in Brindolla, their new world, for a short time, but every minute has been amazing. Kicking butt and not bothering to take names, the group has been moving forward in their quest to push back War, the galactic tyrant.</p> <p>Then the unthinkable happens: Their friend is banished to the darkest Hells. Poof! Gone...just like that.&nbsp;</p> <p>Now, not only are they on a quest to stop the vanguard of War, but they are going to need to get stronger, faster, and better than ever before if they want to have any hope of busting into the Hells and getting their friend back.&nbsp;</p> <p>The Brindollan Gods plan to help as much as they can, but will it be enough to allow them to complete a task that even Orpheus in Earth's mythology couldn’t?</p> <p>With the odds looking bleak and the world they’re trying to defend turning against them, they’re going to need to seek help from unlikely spaces, travel to new places, and break some faces.</p>"; 
